        <div className="container_sheet">
            <div className="sheet">
                <div className="content_sheet">
                    <div className="text_sheet">
                        <div className="info">
                            //건강검진표 추출 내용
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Sheet;
